DROP TABLE IF EXISTS `personne`;
CREATE TABLE `personne` (
                            `id` int(11) NOT NULL AUTO_INCREMENT,
                            `nom_personne` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `prenom_personne` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `email` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `sexe` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `mot_passe` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `role` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            PRIMARY KEY (`id`)
);




DROP TABLE IF EXISTS `campus`;
CREATE TABLE `campus` (
                          `id` int(11) NOT NULL AUTO_INCREMENT,
                          `nom_campus` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                          `adresse_campus` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                          `ville` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                          `code_postal` int(11) NOT NULL,
                          PRIMARY KEY (`id`)
);



DROP TABLE IF EXISTS `batiment`;
CREATE TABLE `batiment` (
                            `id` int(11) NOT NULL AUTO_INCREMENT,
                            `campus_id` int(11) NOT NULL,
                            `nom_batiment` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            `adresse_batiment` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                            PRIMARY KEY (`id`),
                            FOREIGN KEY (`campus_id`) REFERENCES `campus` (`id`)
);


DROP TABLE IF EXISTS `etage`;
CREATE TABLE `etage` (
                         `id` int(11) NOT NULL AUTO_INCREMENT,
                         `batiment_id` int(11) NOT NULL,
                         `nom_etage` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                         PRIMARY KEY (`id`),
                         FOREIGN KEY (`batiment_id`) REFERENCES `batiment` (`id`)
);


DROP TABLE IF EXISTS `salle`;
CREATE TABLE `salle` (
                         `id` int(11) NOT NULL AUTO_INCREMENT,
                         `batiment_id` int(11) NOT NULL,
                         `etage_id` int(11) NOT NULL,
                         `nom_salle` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                         PRIMARY KEY (`id`),
                         FOREIGN KEY (`etage_id`) REFERENCES `etage` (`id`),
                         FOREIGN KEY (`batiment_id`) REFERENCES `batiment` (`id`)
);



DROP TABLE IF EXISTS `capteur`;
CREATE TABLE `capteur` (
                           `id` int(11) NOT NULL AUTO_INCREMENT,
                           `nom_capteur` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                           `is_deleted` tinyint(1) DEFAULT '0',
                           PRIMARY KEY (`id`)
);


DROP TABLE IF EXISTS `alerte`;
CREATE TABLE `alerte` (
                          `id` int(11) NOT NULL AUTO_INCREMENT,
                          `date` datetime NOT NULL,
                          `titre` varchar(255) NOT NULL,
                          `message` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                          `personne_id` int(11) NOT NULL,
                          `salle_id` int(11) NOT NULL,
                          `checked` tinyint(1) NOT NULL,
                          PRIMARY KEY (`id`),
                          FOREIGN KEY (`personne_id`) REFERENCES `personne` (`id`),
                          FOREIGN KEY (`salle_id`) REFERENCES `salle` (`id`)
);


DROP TABLE IF EXISTS `capteur_salle`;
CREATE TABLE `capteur_salle` (
                                 `id` int(11) NOT NULL AUTO_INCREMENT,
                                 `nom_capteur` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
                                 `position` varchar(255) NOT NULL,
                                 `salle_id` int(11) NOT NULL,
                                 `date_debut` datetime NOT NULL,
                                 `date_fin` datetime DEFAULT NULL,
                                 PRIMARY KEY (`id`),
                                 FOREIGN KEY (`salle_id`) REFERENCES `salle` (`id`)
);



DROP TABLE IF EXISTS `enquete`;
CREATE TABLE `enquete` (
                           `id_info_enquete` int(11) NOT NULL AUTO_INCREMENT,
                           `id_user` int(11) NOT NULL,
                           `sexe` tinyint(1) NOT NULL,
                           `age` int(11) NOT NULL,
                           `situation` varchar(250) NOT NULL,
                           `domaine` varchar(250) DEFAULT NULL,
                           `diplome` varchar(250) NOT NULL,
                           `parent` tinyint(1) NOT NULL,
                           `commune` varchar(250) NOT NULL,
                           `mot1` varchar(250) DEFAULT NULL,
                           `mot2` varchar(250) DEFAULT NULL,
                           `mot3` varchar(250) DEFAULT NULL,
                           `date_creation` datetime DEFAULT NULL,
                           PRIMARY KEY (`id_info_enquete`),
                           FOREIGN KEY (`id_user`) REFERENCES `personne` (`id`)
);



DROP TABLE IF EXISTS `info_sensibilisation`;
CREATE TABLE `info_sensibilisation` (
                                        `id_info_sensibilisation` int(11) NOT NULL AUTO_INCREMENT,
                                        `id_user` int(11) NOT NULL,
                                        `q_air_quartier` varchar(250) NOT NULL,
                                        `pollution` tinyint(1) NOT NULL,
                                        `q_air_general` tinyint(1) NOT NULL,
                                        `prev_quotidien_q_air_ext` tinyint(1) NOT NULL,
                                        `effet_pollution_air_sante` tinyint(1) NOT NULL,
                                        `recommandation_proteger_pollution_quotidienne` tinyint(1) NOT NULL,
                                        `pics_pollution` tinyint(1) NOT NULL,
                                        `precautions_pic_pollution` tinyint(1) NOT NULL,
                                        `sources_pollution_air_inter` tinyint(1) NOT NULL,
                                        `sources_pollution_air_exter` tinyint(1) NOT NULL,
                                        `moyens_air_sain_inter` tinyint(1) NOT NULL,
                                        `moyens_air_sain_exter` tinyint(1) NOT NULL,
                                        `actions_publiques_ameliorer_qualite_air` tinyint(1) NOT NULL,
                                        `saison_pollue` varchar(250) NOT NULL,
                                        `impact_sante` varchar(250) NOT NULL,
                                        `impact_air_pollue_organe` varchar(250) DEFAULT NULL,
                                        `aeration_logement` tinyint(1) NOT NULL,
                                        `frequence_aeration_logement` varchar(250) DEFAULT NULL,
                                        `eviter_trafic_velo` varchar(250) NOT NULL,
                                        `sport` tinyint(1) NOT NULL,
                                        `sport_route_trafic` tinyint(1) DEFAULT NULL,
                                        `remarques` varchar(250) DEFAULT NULL,
                                        `date_creation` datetime DEFAULT NULL,
                                        PRIMARY KEY (`id_info_sensibilisation`),
                                        FOREIGN KEY (`id_user`) REFERENCES `personne` (`id`)
);



DROP TABLE IF EXISTS `rasberry`;
CREATE TABLE `rasberry` (
                            `id_rasberry` int(11) NOT NULL,
                            `id_salle` int(11) DEFAULT NULL,
                            PRIMARY KEY (`id_rasberry`),
                            FOREIGN KEY (`id_salle`) REFERENCES `salle` (`id`)
);





DROP TABLE IF EXISTS `sensation_salles`;
CREATE TABLE `sensation_salles` (
                                    `id_sensation` int(11) NOT NULL AUTO_INCREMENT,
                                    `id_salle` int(11) NOT NULL,
                                    `id_user` int(11) NOT NULL,
                                    `id_sensor` int(11) NOT NULL,
                                    `q_air_hei` varchar(250) NOT NULL,
                                    `dist_fenetre` varchar(250) NOT NULL,
                                    `dist_ventilo` varchar(250) NOT NULL,
                                    `climat_salle` varchar(250) NOT NULL,
                                    `temp_sensation` varchar(250) NOT NULL,
                                    `capteur_temp` varchar(250) NOT NULL,
                                    `air_sensation` varchar(250) NOT NULL,
                                    `air_agreable` varchar(250) NOT NULL,
                                    `odeur` varchar(250) NOT NULL,
                                    `poussiere` tinyint(1) NOT NULL,
                                    `symptomes` varchar(250) NOT NULL,
                                    `q_air_salle` varchar(250) NOT NULL,
                                    `date_creation` datetime DEFAULT NULL,
                                    PRIMARY KEY (`id_sensation`),
                                    FOREIGN KEY (`id_salle`) REFERENCES `salle` (`id`),
                                    FOREIGN KEY (`id_user`) REFERENCES `personne` (`id`)
);



DROP TABLE IF EXISTS `sensors`;
CREATE TABLE `sensors` (
                           `id_sensor` int(11) NOT NULL AUTO_INCREMENT,
                           `id_rasberry` int(11) NOT NULL,
                           `time_info_collected` datetime DEFAULT NULL,
                           `CO` float DEFAULT NULL,
                           `CO2` int(11) DEFAULT NULL,
                           `LMG` float DEFAULT NULL,
                           `dust` float DEFAULT NULL,
                           `formol` float DEFAULT NULL,
                           `humid` float DEFAULT NULL,
                           `light` int(11) DEFAULT NULL,
                           `sound` int(11) DEFAULT NULL,
                           `temperature` float DEFAULT NULL,
                           `tolu` float DEFAULT NULL,
                           PRIMARY KEY (`id_sensor`),
                           FOREIGN KEY (`id_rasberry`) REFERENCES `rasberry` (`id_rasberry`)
);
